import { motion } from "framer-motion";

const AnimatedK = () => {
  // Define the animation variants for the "K"
  const textVariants = {
    hidden: { opacity: 0, scale: 0.5 },
    visible: {
      opacity: 1,
      scale: 1.2,
      transition: { duration: 0.6, yoyo: Infinity, ease: "easeInOut" },
    },
  };

  return (
    <motion.svg
      xmlns="http://www.w3.org/2000/svg"
      enableBackground="new 0 0 24 24"
      height="48px"
      viewBox="0 0 24 24"
      width="48px"
    >
      <motion.text
        x="50%"
        y="50%"
        fontSize="16"
        fontFamily="Arial"
        fill="black"
        textAnchor="middle"
        dominantBaseline="middle"
        variants={textVariants}
        initial="hidden"
        animate="visible"
      >
        K
      </motion.text>
    </motion.svg>
  );
};

export default AnimatedK;
